// src/pages/Users.js
import React from 'react';
import UserTable from '../components/UserTable';

const Users = () => {
    return (
        <div>
            <h1>Users Page</h1>
            <p>List of users will be displayed here.</p>
            <UserTable/>
        </div>
    );
};

export default Users;
